xwikidoc.content:
The view-file macro displays attachments in a document, in place or as thumbnail and offers a preview.
Limitation: the thumbnail is actually only an icon for now.
= Parameters =
|=Parameter|=Description|=Required|=Default |display|Kind of display. "button" for a button, "thumbnail" for a thumbnail, "full" to render the document in place|no|thumbnail (button in inline mode) |name|The attachment reference to display|if att--filename is not given| |page|The page from where you want the attachments to be displayed. Modifying this parameter will reset the selected file value|no| |width|The width of the view in % or px (e.g. 100%, 100px)|no|100% for the full view or 100px for the thumbnail |height|The height of the view in % or px (e.g. 100%, 100px)|no|1000px for the full view or 100px for the thumbnail |att--filename|Alias of name|If name is not given|
= Example Usage =
Thumbnails side by side:
{{view-file display="thumbnail" name="Test.ppt"/}} {{view-file display="thumbnail" name="TestPDF.pdf"/}}
Or standalone:
{{view-file name="Test.ppt"/}}
In a paragraph: {{view-file name="Test.ppt"/}}
Full PDF:
{{view-file display="full" name="TestPDF.pdf"/}}
Full Presentation:
{{view-file display="full" name="Test.ppt"/}}

property.code:
require.config({
  paths: {
    'xwiki-suggestAttachments': "$xwiki.getSkinFile('uicomponents/suggest/suggestAttachments.js', true)" +
    "?v=$escapetool.url($xwiki.version)"
  }
});

// As there is no platform implementation to allow the user to dynamically select the page from where the attachments
// are shown, a custom implementation was made to dynamically update the displyed attachments in corelation to the
// selected page parameter. This can be removed after the implementation of https://jira.xwiki.org/browse/XWIKI-22850.
require(['jquery', 'xwiki-meta', 'xwiki-suggestAttachments'], function($, xm) {
  const acceptedExtensions = '.ppt,.pptx,.odp,.doc,.docx,.odt,.xls,.xlsx,.ods,.pdf';
  const styleObserver = new MutationObserver(function(mutations) {
    for (const mutation of mutations) {
      if (mutation.target.style.display === 'none') {
        styleObserver.disconnect();
        pageObserver.observe(document.body, { childList: true, subtree: true });
        return;
      }
    }
  });

  const initializeAttachments = function(selectElement) {
    let scope = "document:";
    if (selectElement.val() != null) {
      scope += selectElement.val();
    }
    var inputElement = $('input[name="name"]');
    if (inputElement.length) {
      let selectize = inputElement.siblings('.selectize-control');
      if (selectize.length) {
        selectize.remove();
        inputElement.removeAttr("class tabindex style").val('');
        const clone = inputElement.clone().appendTo(inputElement.parent());
        inputElement.remove();
        inputElement = clone;
      }
      const allowUpload = selectElement.val() == xm.document || !selectElement.val();
      inputElement.suggestAttachments({
        maxItems: 1,
        accept: acceptedExtensions,
        searchScope: scope,
        uploadAllowed: allowUpload
      });
    }
  }

  const pageObserver = new MutationObserver(function(mutationsList, observer) {
    const selectElement = $('select[name="page"]');
    if (selectElement.length) {
      const modal = selectElement.closest(".macro-editor-modal")[0];
      if (modal.style.display !== 'none') {
        observer.disconnect();
        styleObserver.observe(modal, { attributes: true, attributeFilter: ['style'] });
        $(selectElement).change(function() {
          initializeAttachments($(this))
        });
        initializeAttachments(selectElement)
      }
    }
  });

  pageObserver.observe(document.body, { childList: true, subtree: true });

  $(document).on("click", async function (e) {
    if (("" + document.getElementById("xwikicontent")?.contentEditable) == "true") {
      return;
    }
    const viewFile = e.target?.closest(".viewFileThumbnail");
    if (viewFile && viewFile.dataset.preview === 'true') {
      const popup = new XWiki.widgets.ModalPopup();
      popup.createDialog();
      popup.setContent("<span class='fa fa-spinner'></span>");
      popup.dialogBox.classList.add("viewFileModal");
      popup.dialogBox.style.top = "2.5vh";
      popup.dialogBox.style.width = "95vw";
      popup.dialogBox.style.height = "95vh";
      const a = e.target.closest('a');
      const downloadLink = document.createElement("a");
      downloadLink.download = true;
      downloadLink.textContent = " " + $(a).find(".viewFileName").text();
      downloadLink.className = 'fa fa-download button button-primary viewFileModal-downloadLink';
      downloadLink.href = a.href;
      popup.dialogBox.insertBefore(downloadLink, popup.dialogBox.firstChild)
      popup.showDialog();
      e.preventDefault();
      const response = await fetch(XWiki.contextPath + "/wiki/" + XWiki.currentWiki + "/get/Confluence/Macros/ViewFileService?action=render&attachment=" + encodeURIComponent(viewFile.dataset.ref));
      popup.setContent(await response.text());
      const gallery = popup.dialogBox.querySelector(".gallery");
      if (gallery) {
        new XWiki.Gallery(gallery);
      }
    }
  });
});

